    false,nt"url": null,nt"notes": "Research Ship Tangaroa Underway Meteorological
    Data (delayed ~10 days for quality control) are from the Shipboard Automated Meteorological
    and Oceanographic System (SAMOS) program.nnIMPORTANT: ALWAYS USE THE QUALITY FLAG
    DATA! Each data variable's metadata includes a qcindex attribute which indicates
    a character number in the flag data.  ALWAYS check the flag data for each row of
    data to see which data is good (flag='Z') and which data isn't.  For example, to
    extract just data where time (qcindex=1), latitude (qcindex=2), longitude (qcindex=3),
    and airTemperature (qcindex=12) are 'good' data, include this constraint in your
    ERDDAP query:n flag=~"ZZZ........Z.*"nin your query.n'=~' indicates this is a
    regular expression constraint.nThe 'Z's are literal characters.  In this dataset,
    'Z' indicates 'good' data.nThe '.'s say to match any character.nThe '*' says to
    match the previous character 0 or more times.n(Don't include backslashes in your
    query.)nSee the tutorial for regular expressions atnhttp://www.vogella.de/articles/JavaRegularExpressions/article.html",nt"license_title":
